import React from 'react';
import './showTweets.css';
import EnterNewTweet from './enterNewtweet/enterNewTweet';
import DisplayTweets from './displaytweets/displayTweets';

const ShowTweets = () => {
    return (
        <div className="ShowTweets">
            <EnterNewTweet />
            <DisplayTweets />
        </div>
    );
}

export default ShowTweets;
